import './App.css';
import styled from 'styled-components';
function App() {
  return (
    <Container>
      <Content>
      <h3>What's the plan for Today</h3>
      < InputContent>
      <input/>
      <button></button>
      </InputContent>
      </Content>
    </Container>
  );
}

export default App;


const Container =styled.div`
width:100vw;
height:100vh;

background-color:rgb(107, 3, 252);
display:flex;
justify-content:center;
align-items:center;

`


const Content =styled.div`
width:30%;
height:auto;
background-color:rgb(47, 46, 48);
text-align:center;
box-sizing:border-box;
color:#ffff;
display:flex;
align-items:center;
flex-direction:column;


`

